  Code = "class Solution:\n    def checkPrimeFrequency(self, nums: List[int]) -> bool:\n        def is_prime(v: int) -> bool:\n            for i in range(2, int(math.sqrt(v)) + 1):\n                if v % i == 0:\n                    return False\n            return True\n        freqs = [0] * 101\n        for num in nums:\n            freqs[num] += 1\n        for freq in freqs:\n            if freq > 1 and is_prime(freq):\n                return True\n        return False"
